import React from 'react'
import Video  from "./Video";
const VideoGrid = () => {
    const images = [1,3,5,7];

    return (
        <div className="w-100 mt-5 mb-5">

        {images.map(img => (
            <div className="music-grid-left">
                <Video key={img} video={img} className="video-left-big"/>
                <Video key={img+1} video={img+1} className="video-left-small"/>
            </div>
        ))}

        </div>
    )
}

export default VideoGrid
